import React from "react";
import "../styleSheet.css";
import InputsValue from "./InputValue";

class Front extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  handleSubmit(data) {
    this.setState(data);
  }
  render() {
    return (
      <div>
        <InputsValue onSubmit={handleSubmit} />
        <OldSlab data={this.state} />
        <NewSlab data={this.state} />
      </div>
    );
  }
}

export default Front;
